import React from 'react'
import {RootContent} from '../../../UIComponents/GlobalStyles'
import {FixedHeader} from '../../../Components/FixedHeader'
import {HomeFixedHeaderComponent} from '../organisms/home-fixed-header-component'
import {useHomeList} from '../../../Hooks/home'
import {OrganizationsList} from '../organisms'

export const Home = () => {
    const {loadMore} = useHomeList()

    return (
        <RootContent
            height='100vh'
        >
            <FixedHeader
                component={<HomeFixedHeaderComponent/>}
            />
            <OrganizationsList loadMore={loadMore}/>
        </RootContent>
    )
}
